import React, {useState, useEffect} from  "react";
import AdminDashboardNavBar from "./AdminDashboardNavBar";
import StructureAdmin from "./StructureAdmin";
import axios from "axios";
import {useSelector, useDispatch} from "react-redux";


const AdminDashboardPending = () => {
    const [order, setOrder] = useState([""]);

    const dispatch = useDispatch();
    const { auth, errors } = useSelector( state => ({
    auth: state.auth,
    errors: state.errors,
    }));  

    useEffect(() => {

        axios.get(`/api/cityrunner/adminpending`)
        .then((res) => {
            setOrder(res.data);
        }).catch(error =>{
            console.log(error);
        })


    });
    return(
        <div>
            <AdminDashboardNavBar />
            <div>
            <p className="ontop-form ontop-form2 ontop-dash ontop-dash1"><b>Ongoing</b> Orders</p>

            </div>
            <div className="table">
                <table>
                    <thead>
                    <tr>
                        <td>
                            Order ID
                            </td>
                            <td>
                            User ID
                            </td>
                            <td>
                            Item
                            </td>
                            <td>
                            Pick-up Address
                            </td>
                            <td>
                            Sender Name
                            </td>
                            <td>
                            Sender Phone Number
                            </td>
                            <td>
                            Sender E-mail
                            </td>
                            <td>
                            Pick-up Date
                            </td>
                            <td>
                            Order Charge
                            </td>
                            <td>
                            Item Weight
                            </td>
                            <td>
                            Item Quantity
                            </td>
                            <td>
                            Recipient Address
                            </td>
                            <td>
                            Recipient Name
                            </td>
                            <td>
                            Recipient Phone Number
                            </td>
                            <td>
                            Recipient E-mail
                            </td>
                            <td>
                            Order Status
                            </td>
                            <td>
                            Delivered by Rider ID
                            </td>
                        </tr>
                    </thead>
                    <tbody>

                    </tbody>
                </table>

            </div>
  {order.map((data, index) => {
             return(
                 <StructureAdmin 
                 key = {index}
                 id= {data._id}
                 user = {data.user}
                 pickupitem = {data.pickupitem}
                 pickupaddress = {data.pickupaddress}
                 name= {data.name}
                 phone = {data.phone}
                 email = {data.email}
                 pickupdate = {data.pickupdate}
                 amountInNaira= {data.amountInNaira}
                 weightinkg = {data.weightinkg}
                 pickupquantity = {data.pickupquantity}
                 deliveryaddress = {data.deliveryaddress}
                 deliveryname= {data.deliveryname}
                 deliveryphonenumber = {data.deliveryphonenumber}
                 deliveryemail ={data.deliveryemail}
                 status = {data.status}
                 rider = {data.rider}

                 />);
         })}
     </div>
    )
}

export default AdminDashboardPending;
